// Pagamentos.js
import React from 'react';
import { View, Text } from 'react-native';
import { styles } from './styles';

export default function Pagamentos() {
  return (
    <View style={styles.container}>
      <Text style={styles.text}>Pagamentos</Text>
    </View>
  );
}
